  "description": "**Description:** Allowed values for the FormatCode in the XDS-Matadata, within ELGA.      In case of an ELGA CDA document with the interoperability level ''Enhanced'' or ''Full Support'' and additionally containing self-defined machine readable elements, this needs to be labeled using ''+'' (Plus-Sign) within the Formatcode.      E.g.: ''urn:elga:dissum:2011:EIS_FullSupport+''     \n\n**Beschreibung:** Zur Verwendung in ELGA erlaubte Werte f\u00fcr den FormatCode in den XDS-Metadaten.     Liegt ein CDA Dokument in ELGA Interoperabilit\u00e4tsstufe ''Enhanced'' oder ''Full Support'' vor und enth\u00e4lt das Dokument zus\u00e4tzliche selbst-definierte maschinenlesbare Elemente, so ist dies durch ein ''+'' (Plus-Zeichen) als Zusatz im Formatcode gekennzeichnet werden.      ZB: ''urn:elga:dissum:2011:EIS_FullSupport+''",
